import React from "react";

function Footer() {
  return (
    <div className="footer">
      <p>
        Made by Reuben Udu-Wallace. Visit my{" "}
        <a
          href="https://github.com/rubixcubereubs/"
          target="_blank"
          rel="noopener noreferrer"
        >
          Github
        </a>{" "}
        and my{" "}
        <a
          href="https://www.linkedin.com/in/reuben-udu-wallace-5004371b4"
          target="_blank"
          rel="noopener noreferrer"
        >
          LinkedIn
        </a>
        . <strong>Really like what you see? Offer me a job =)</strong>
      </p>
    </div>
  );
}

export default Footer;
